import React, { useState, useEffect } from "react";
import { decodeToken } from "react-jwt";
import Loader from "./Loader";

const Prodata = ({ decodedToken }) => {
  const [data, setData] = useState();

  useEffect(async () => {
    if (await decodedToken) {
      console.log(await decodeToken);
    }
    //  setData(await decodedToken)
  }, [decodeToken]);

  return (
    // decodeToken?<Loader/> :
    <div className="min-h-screen w-2/3 mx-auto flex justify-center flex-col p-4">
      <div className="flex flex-col text-3xl p-3 items-center  justify-center border-2">
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="h-12 w-9"
          viewBox="0 0 20 20"
          fill="currentColor"
        >
          <path
            fillRule="evenodd"
            d="M10 9a3 3 0 100-6 3 3 0 000 6zm-7 9a7 7 0 1114 0H3z"
            clipRule="evenodd"
          />
        </svg>
      </div>
      <div className="flex flex-col justify-evenly border-2 h-full">
          <div className="flex flex-col sm:flex-row text-center justify-center w-full p-3">
           <label className="pr-2">NOM & Prenom: </label>
           <p className="">carnelilordwiz@gmail.com</p>
          </div>
          <div className="flex flex-col sm:flex-row text-center justify-center w-full p-3">
           <label className="pr-2">Email:</label>
           <p className="">carnelilordwiz@gmail.com</p>
          </div>
          <div className="flex flex-col sm:flex-row text-center justify-center w-full p-3">
           <label className="pr-2">Email:</label>
           <p className="">carnelilordwiz@gmail.com</p>
          </div>
          <div className="flex flex-col sm:flex-row text-center justify-center w-full p-3">
           <label className="pr-2">Staut de Votre Souscription:</label>
           <p className="">undefined</p>
          </div>
      </div>
    </div>
  );
};

export default Prodata;
